import logo from './logo.svg';
import './App.css';

import React from 'react';
import Button from '@mui/material/Button';

import ProductTable from './components/ProductTable';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Tabla de Productos</h1>
      </header>
      <main>
        <ProductTable />
      </main>
    </div>
  );
}

export default App;
